// router.js
import { createRouter, createWebHistory } from 'vue-router';
import Home from './views/Home.vue'; // Import your components

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home
  },
  // Add other routes here
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
